import React from 'react';
import ReactDOM from 'react-dom';


// const root = ReactDOM.createRoot(
//     document.getElementById('root')
// );
// const element = <h1>Hello, world</h1>;
// root.render(element);

const root = ReactDOM.createRoot(
    document.getElementById('root')
);

function tick() {
    const element = (
        <div>
            <h1>Hello, world!</h1>
            <h2>It is {new Date().getTime()}.</h2>
        </div>
    );
    root.render(element);
}

setInterval(tick, 1000);
